import React, { Component } from "react";
import LeftSide from "./left_side/left_side";
import RightSide from "./right_side/right_side";

// Подключается левая и правая часть

export default class Main extends Component {
  render() {
    return (
      <div className="row">
        <LeftSide />
        <RightSide />
      </div>
    );
  }
}
